import firebase from "firebase/app"
import "firebase/auth"
import "./config"


const firebaseConfig = {
    apiKey: process.env.MMC_API_KEY,
    authDomain: process.env.MMC_AUTH_DOMAIN,
    projectId: process.env.MMC_PROJECT_ID,
    storageBucket: process.env.MMC_STORAGE_BUCKET,
    messagingSenderId: MMC_MESSAGING_SENDER_ID,
    appId: MMC_APP_ID
  };


// Initialize Firebase
const app = initializeApp(firebaseConfig);

export const auth = app.auth()
export default app
